import React from 'react';

const Frame6 = () => {
  return (
    <div
      style={{
        width: '1440px',
        height: '555px',
        background: 'linear-gradient(to bottom, #fce3df 0%, #ffffff 40%)',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        boxSizing: 'border-box',
      }}
    >
      {/* Frame6 background only, all Frame6a content removed */}
    </div>
  );
};

export default Frame6;
